import React from "react";
import {
    BrowserRouter as Router, Route, Routes
} from "react-router-dom";
import HomeMainPage from "../pages/Home/Home";
import AboutMainPage from "../pages/About/About";
import ProductMainPage from "../pages/Product/Product";

import HomeLink from "./Nav/HomeLink";
import AboutLink from "./Nav/AboutLink";
import ProductLink from "./Nav/ProductLink";


export default function Ccomponent() {
    return (
        <Router>
            <div>
                {/* <nav>
                    <ul>
                        <li>
                            <HomeLink />
                        </li>
                        <li>
                            <AboutLink />
                        </li>
                        <li>
                            <ProductLink />
                        </li>
                    </ul>
                </nav > */}
                <Routes>

                    <Route exact path="/" element={<Home />} />

                    <Route exact path="/about" element={<About />} />

                    <Route exact path="/product" element={<Product />} />

                </Routes>
            </div >
        </Router >
    )
}
